f the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'ID-ul bazei de date al nav_menu_item care este părintele meniului pentru acest element, dacă există unul. În caz contrar, 0.','The type of object originally represented, such as "category", "post", or "attachment".'=>'Tipul de obiect reprezentat inițial, cum ar fi „categorie”, „articol” sau „atașament”.','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'ID-ul din baza de date al obiectului inițial pe care îl reprezintă acest element de meniu, de exemplu, ID pentru articole sau term_id pentru categorii.','The target attribute of the link element for this menu item.'=>'Atributul țintă al elementului de legătură pentru acest element de meniu.','The singular label used to describe this type of menu item.'=>'Singura etichetă folosită pentru a descrie acest tip de element de meniu.','The URL to which this menu item points.'=>'URL-ul la care indică acest element de meniu.','The XFN relationship expressed in the link of this menu item.'=>'Relația XFN exprimată în legătura acestui element de meniu.','Whether the menu item represents an object that no longer exists.'=>'Dacă elementul de meniu reprezintă un obiect care nu mai există.','The terms assigned to the object in the %s taxonomy.'=>'Termenii atribuiți obiectului în taxonomia %s.','An alphanumeric identifier for the menu location.'=>'Un identificator alfanumeric pentru locația meniului.','Invalid menu location.'=>'Locația meniului nu este validă.','The name of the menu location.'=>'Numele locației meniului.','The description of the menu location.'=>'Descrierea locației meniului.','The ID of the assigned menu.'=>'ID-ul meniului atribuit.','Sorry, you are not allowed to view menus.'=>'Regret, nu ai voie să vezi meniurile.','Menus do not support trashing. Set \'%s\' to delete.'=>'Meniurile nu pot fi aruncate la gunoi. Setează „%s” pentru a le șterge.','The menu cannot