t folosi acest model.','Block pattern categoryBanners'=>'Bannere','Block pattern categoryPosts'=>'Articole','Block pattern categoryTeam'=>'Echipă','Block pattern categoryAbout'=>'Despre','Used as a fallback template for all pages when a more specific template is not defined.'=>'Folosit ca șablon alternativ în toate paginile când nu este definit un șablon specific.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Afișează ultimele articole fie ca prima pagină a site-ului, fie ca o „Pagină Articole”, așa cum este definită în setările Afișare. Dacă există, șablonul Pagina din față contramandează acest șablon când articolele sunt afișate pe prima pagină.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Afișează prima pagină a site-ului tău, indiferent dacă este setată să afișeze cele mai recente articole sau o pagină statică. Șablonul Pagina din față are prioritate față de toate celelalte șabloanele.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Afișează orice intrare unică, cum ar fi un articol sau o pagină. Acest șablon va servi ca alternativă când nu poate fi găsit un șablon specific (de exemplu, Articol singular, Pagină sau Atașament).','Displays single posts on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Afișează articole singulare pe site, cu excepția cazului în care a fost aplicat un șablon personalizat articolului respectiv sau dacă există un șablon dedicat.','Display all static pages unless a custom template has been applied or a dedicated template exists.'=>'Afișează toate paginile statice, cu excepția cazului în care a fost aplicat un șablon personalizat sau dacă există un șablon dedicat.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Afișează orice arhivă, inclusiv articolele cu un singur autor, categorii, etichete, taxonomii, tipuri de articol personalizat sau date. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Categorie sau Etichetă).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Afișează o arhivă cu articolele unui singur autor. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Autor: administrator).','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Afișează o arhivă cu categoriile de articole. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Categorie: rețete).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Afișează o arhivă cu taxonomii personalizate. La fel ca etichetele și categoriile, taxonomiile au termeni pe care îi folosești ca să clasifici lucrurile. De exemplu, taxonomia numită „Artă” poate să aibă mai mulți termeni, cum ar fi „modernă” și „secolul al XVIII-lea”. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Taxonomie: artă).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Afișează o arhivă cu articole când este căutată o anumită dată (de exemplu, exemplu.com/2023/).','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Afișează o arhivă cu etichetele articolelor. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Etichetă: pizza).','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'Afișează când un vizitator vede pagina dedicată care există pentru orice atașament media.','Displays when a visitor performs a search on your website.'=>'Afișează când un vizitator efectuează o căutare pe site-ul tău.','Displays your site\'s Privacy Policy page.'=>'Afișează pagina Politica de confidențialitate a site-ului.','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Afișează când un vizitator vede o pagină inexistentă, cum ar fi o legătură inactivă sau un URL introdus greșit.','template part areaGeneral'=>'Generale','template part areaHeader'=>'Antet','template part areaFooter'=>'Subsol','Template nameBlog Home'=>'Prima pagină a blogului','Template nameSingle Entries'=>'Intrări singulare','Template nameAll Archives'=>'Toate arhivele','Template nameAuthor Archives'=>'Arhive autori','Template nameCategory Archives'=>'Arhive categorii','Template nameDate Archives'=>'Arhive date','Template nameTag Archives'=>'Arhive etichete','Attachment Pages'=>'Pagini cu atașamente','Template nameSearch Results'=>'Rezultate de căutare','Template namePage: 404'=>'Pagină: 404',' … <a href="%1$s" rel="noopener noreferrer">Read more</a>'=>' ... <a href="%1$s" rel="noopener noreferrer">Citește mai mult</a>','Expand search field'=>'Extinde câmpul de căutare','The menu provided is not a valid menu.'=>'Meniul pe care l-ai furnizat nu este un meniu valid.','"%s" in theme.json settings.color.duotone is not a hex or rgb string.'=>'„%s” din theme.json